import React from 'react';
import heartIcon from './heart.png';

export default function Wishlist({ wishlistItems, onRemove }) {
  if (wishlistItems.length === 0) {
    return (
      <div style={{ minHeight: '100vh' }} className="bg-light pt-5">
        <div className="container">
          <div className="card shadow-lg p-5 text-center card-3d">
            <h2 className="h3 fw-bold text-dark mb-3"><img src={heartIcon} alt="Wishlist" style={{ width: '24px', height: '24px', marginRight: '8px' }} />Votre liste de souhaits est vide</h2>
            <p className="text-muted">Ajoutez des articles √† votre liste!</p>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div style={{ minHeight: '100vh' }} className="bg-light pt-5 pb-5">
      <style>{`
        .btn-3d {
          width: 100%;
          cursor: pointer;
          border: 0;
          background: transparent;
          color: #fff;
          padding: 10px 12px;
          font-weight: bold;
          font-size: 14px;
          text-transform: uppercase;
          letter-spacing: 0.1em;
          position: relative;
        }

        .block-cube {
          position: relative;
        }

        .block-cube .bg-top {
          position: absolute;
          height: 8px;
          background: linear-gradient(90deg, #dc3545 0%, #b02a37 100%);
          bottom: 100%;
          left: 3px;
          right: -3px;
          transform: skew(-45deg, 0);
          transition: all 0.2s ease-in-out;
        }

        .block-cube .bg-right {
          position: absolute;
          background: #dc3545;
          top: -3px;
          bottom: 3px;
          width: 8px;
          left: 100%;
          transform: skew(0, -45deg);
          transition: all 0.2s ease-in-out;
        }

        .block-cube .bg {
          position: absolute;
          left: 0;
          top: 0;
          right: 0;
          bottom: 0;
          background: linear-gradient(90deg, #dc3545 0%, #b02a37 100%);
          transition: all 0.2s ease-in-out;
        }

        .block-cube .bg-inner {
          background: #a02622;
          position: absolute;
          left: 2px;
          top: 2px;
          right: 2px;
          bottom: 2px;
          transition: all 0.2s ease-in-out;
        }

        .block-cube-hover:hover .bg-inner {
          top: 100% !important;
        }

        .text-label {
          position: relative;
          z-index: 3;
        }

        /* 3D Card effect */
        .card-3d {
          transition: transform 0.3s ease, box-shadow 0.3s ease;
          box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
        }

        .card-3d:hover {
          transform: translateY(-5px);
          box-shadow: 0 15px 30px rgba(0, 0, 0, 0.2);
        }
      `}</style>
      <div className="container">
        <h2 className="h3 fw-bold text-dark mb-4"><img src={heartIcon} alt="Wishlist" style={{ width: '24px', height: '24px', marginRight: '8px' }} />Ma Liste de Souhaits</h2>

        <div className="row">
          {wishlistItems.map((item) => (
            <div key={item._id} className="col-md-4 col-lg-3 mb-4">
              <div className="card shadow-lg h-100 card-3d">
                <div className="card-body">
                  <h5 className="card-title">{item.name}</h5>
                  <p className="card-text text-muted small">{item.category}</p>
                  <div className="d-flex justify-content-between align-items-center mb-3">
                    <span className="text-primary fw-bold">üí∞{item.price}</span>
                    <span className="text-warning">‚≠ê {item.rating || 'N/A'}</span>
                  </div>
                  <button
                    onClick={() => onRemove(item._id)}
                    className="btn-3d block-cube block-cube-hover"
                  >
                    <div className="bg-top"><div className="bg-inner"></div></div>
                    <div className="bg-right"><div className="bg-inner"></div></div>
                    <div className="bg"><div className="bg-inner"></div></div>
                    <span className="text-label">‚ùå Supprimer</span>
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
